{
  "name": "TeleDrive",
  "description": "Free cloud storage via telegram",
  "keywords": [
    "cloud",
    "drive",
    "telegram",
    "free",
    "storage",
    "unlimited"
  ],
  "website": "https://teledriveapp.com",
  "repository": "https://github.com/mgilangjanuar/teledrive",

  "addons": [
    "heroku-postgresql"
  ],
  "env": {
    "ENV": {
      "description": "Hide the logs for production, default: develop. Read more at: https://teledriveapp.com/docs/Deployment/heroku",
      "required": false
    },
    "REACT_APP_API_URL": {
      "description": "Base URL for the API, default: '' (empty string).",
      "required": false
    },
    "REACT_APP_TG_API_HASH": {
      "description": "Application hash from Telegram App (for experimental features).",
      "required": true
    },
    "REACT_APP_TG_API_ID": {
      "description": "Application ID from your Telegram App (for experimental features).",
      "required": true
    },
    "TG_API_HASH": {
      "description": "Application hash from Telegram App.",
      "required": true
    },
    "TG_API_ID": {
      "description": "Application ID from your Telegram App.",
      "required": true
    },
    "ADMIN_USERNAME": {
      "description": "Username Telegram for admin account.",
      "required": true
    },
    "USE_PSQL_HEROKU": {
      "description": "If we are using Heroku PSQL",
      "required": true,
      "value": "1"
    }
  }
}

{
  "name": "teledrive",
  "version": "2.5.5",
  "repository": "git@github.com:mgilangjanuar/teledrive.git",
  "author": "M Gilang Januar <mgilangjanuar@teledriveapp.com>",
  "license": "MIT",
  "private": true,
  "engines": {
  "node": "18.16.0"
  },

  "scripts": {
    "web": "yarn workspace web",
    "server": "yarn workspace api",
    "api": "yarn workspace api",
    "build": "yarn workspaces run build",
    "start": "cd api && node dist/index.js",
    "docs": "USE_SSH=true cd docs && yarn deploy"
  },
  "workspaces": [
    "web",
    "api"
  ],
  "dependencies": {}
}

const fs = require('fs')
const { execSync } = require('child_process')

const root = fs.readFileSync('./package.json', 'utf-8')
const rootObj = JSON.parse(root)
rootObj.version = process.argv[2]
fs.writeFileSync('./package.json', JSON.stringify(rootObj, null, 2))

const api = fs.readFileSync('./api/package.json', 'utf-8')
const apiObj = JSON.parse(api)
apiObj.version = process.argv[2]
fs.writeFileSync('./api/package.json', JSON.stringify(apiObj, null, 2))
// execSync('cd ./server && yarn install && cd ..')

const web = fs.readFileSync('./web/package.json', 'utf-8')
const webObj = JSON.parse(web)
webObj.version = process.argv[2]
fs.writeFileSync('./web/package.json', JSON.stringify(webObj, null, 2))
// execSync('cd ./web && yarn install && cd ..')

const webVersion = fs.readFileSync('./web/src/utils/Constant.ts', 'utf-8')
fs.writeFileSync('./web/src/utils/Constant.ts', webVersion.replace(/export const VERSION \= \'.*\'/, `export const VERSION = '${process.argv[2]}'`))

execSync('yarn install && yarn workspaces run build')
execSync(`git add . && git commit -m "${process.argv[2]}"`)
